import * as types from '../Actions/actionTypes'
import db from '../firebaseConfig'
const addlog = () =>({
    type:types.ADDLOG
})

export const addlogInitiate =(data)=>{
    return function(dispatch){
        db.collection('logging').doc().set(data)
        dispatch(addlog())
    }
}
